import logo from "./logo.svg";
import "./App.css";
import React from "react";
import { useState } from "react";

function App() {
  const [num, setNum] = useState(1);
  const [result, setResult] = useState({});
  async function stuff() {
    const url = `https://chicken-facts.p.rapidapi.com/facts/order/id/asc/page/${num}.json`;
    const options = {
      method: 'GET',
      headers: {
        'X-RapidAPI-Key': '1fece9cd46msh18f98aab476cdbfp1ac901jsnd793ec542456',
        'X-RapidAPI-Host': 'chicken-facts.p.rapidapi.com'
      }
    };

    try {
      const response = await fetch(url, options);
      const result = await response.text();
      setResult(result.facts)
    } catch (error) {
      console.error(error);
    }
  }
  stuff();
  console.log(result);

  return (
    <div className="App">
    </div>
  );
}

export default App;
